import React from 'react';
import Button from 'react-bootstrap/Button'

function BoostBox() {
    return ( <
        div id = "end-box" >
        <
        h2 > Boost your links today < /h2> <
        Button id = "intro-btn"
        size = "lg" > Get Started < /Button> <
        /div>
    )
}
export default BoostBox;
